INSERT INTO `faq` (`idfaq`, `cdate`, `mdate`, `question`, `answer`) VALUES
(2, '1360743705', '2013-02-13 08:21:45', 'What is the difference between a "Flat Fee MLS listing" and a "Full Service listing"?', 'About 3% in you pocket. With a full service listing you pay a Realtor 3% to input data about your home into a computer (this is what they refer to as marketing), to take phone calls, put a sign in your yard and put a lock box on your front door.<br>\r\nA Realtor will also fill out document for you to sign. In all fairness, Realtors DO play an important roll in the sale of property. One benefit you should receive from using a Realtor is to keep emotion out of the deal so you can concentrate on facts and making good decisions.\r\n \r\nOur flat fee listing services charges a set price to put your homes information on the exact same MLS as a full service listing. The difference being, you take the calls, you put the sign in your yard and a lock box on your door and you fill out the forms. If you are savvy enough to handle these tasks and want to put 3% in your pocket instead of someone else, we recommend our flat rate service. \r\nIf you know you will have a hard time keeping emotion out of negotiations, please contact us for a full service Realtor from the National Association of Realtors and we will be happy to assist you. \r\n'),
(3, '1360754638', '2013-02-13 11:23:58', 'Do I have to pay a commission if a Realtor brings a buyer from my listing?', 'Yes! That’s the deal! In order to use the MLS, you must pay a cooperating broker an amount. This can be whatever amount or percent you feel will sell your home the quickest and for the highest amount. '),
(5, '1360754937', '2013-02-13 11:28:57', 'Do I have to pay a commission if I find my own buyer?', 'No! No and NO. Ah, the beauty of our service.  You only pay a commission if a Realtor finds brings a qualified buyer that is willing to meet all your terms and conditions. When a Buyer finds you off one of the 42 websites the MLS cooperates with, and buys the home from you directly, you pay no selling commissions.'),
(6, '1360754953', '2013-02-13 11:29:13', 'Once I sign-up, how long does it take for my listing to appear? ', 'Your Flat Fee MLS listing will become active 1 to 3 business days after your listing information and pictures are received.'),
(7, '1360754965', '2013-02-13 11:29:25', 'Are there any other charges associated with the Flat Fee MLS listing?', 'No! There are no other charges.'),
(8, '1360754977', '2013-02-13 11:29:37', 'Will I get a chance to review my Flat Fee MLS and make changes?', 'Yes, absolutely! The third step in the process allows you review your listing and make any changes before check out.'),
(9, '1360754989', '2013-02-13 11:29:49', 'Can I make changes to my Flat Fee MLS listing?', 'Yes, all maintenance is included for the life of your MLS listing! Maintenance changes include: change of price, change of commission, change of contact phone number, change of status, error corrections and remark changes. Picture changes are not considered maintenance; they are subject to an additional $20.00 fee per request. Changes are processed within 1-2 business days.'),
(10, '1360755004', '2013-02-13 11:30:04', 'Can I cancel my listing? ', 'Yes! Your listing will run until your property sells or you get sick of people calling… or not calling. Cancel any time.'),
(11, '1360755014', '2013-02-13 11:30:14', 'Will my contact info appear on my listing?', 'Yes! Your name & phone number will appear on your MLS listing. For safety and to track showings, we instruct Realtors to log-in. This gives them you’re showing instructions and you’re contact information. Safety is number one and this method is what I use on all our homes, including my own personal investments'),
(12, '1360755026', '2013-02-13 11:30:26', 'Is this the same MLS that a full service Realtor® would use? ', 'YES! Your property listing is on the exact same MLS that a full service Realtor’s® use. The only difference is that a full service Realtor® charges you a commission and we charge you a flat fee.'),
(13, '1360755039', '2013-02-13 11:30:39', 'Do I need a Realtor® to list my house on the MLS or can I list it by myself? ', 'To list your home on the MLS you must use a Broker who is a member of the National Association of Realtors®. The only way to be listed on the MLS is through a Brokerage, which we are.'),
(14, '1360755051', '2013-02-13 11:30:51', 'What if I find I need more help?', 'Help is just a phone call away. If you find the process of selling your home overwhelming, you are welcome to contact us and speak with a professional. We provide full service real estate listings at a competitive rate.'),
(15, '1360755090', '2013-02-13 11:31:30', 'I forgot my Login and/or Password:', 'No problem! Just <a href="http://flatratelist.com/index.php/user/recovery/recovery">click here</a> to retrieve your password.'),
(16, '1362738030', '2013-03-08 10:20:30', 'I have moved and would like to edit my contact information.', 'Not a problem, go to the home page and click on Ask a Broker. Input your name, your old address and your new address.  This link will take you to the home page. <a href="http://flatratelist.com/index.php/user/profile">click here</a>'),
(17, '1362738057', '2013-03-08 10:20:57', 'I’ve tried and tried to enter my listing but the site won’t let me complete a field or fields. I need help. ', 'At the top right of each page is instant online help. Just click on the Chat box and a customer service representative will be help you with your question right then. If you rather, you can call us at 941.706.7067 and we will be happy to assist you.'),
(18, '1362738163', '2013-03-08 10:22:43', 'Where is my listing seen on the internet?  Your listing is available nationwide through the 40+ websites that grab your listing from our MLS. The illustrations below depict  the area your listing is presented on the MLS. ', '<img src ="http://flatratelist.com/dev/themes/custom/css/images/faq1.jpg" style="width:600px;">\r\n<br>\r\n<img src ="http://flatratelist.com/dev/themes/custom/css/images/faq2.jpg"  style="width:600px;">'),
(19, '1362739393', '2013-03-08 10:43:13', 'I Don''t Have a Paypal Account. Can I Pay With a Credit Card?', 'You CAN pay with a credit card and do not have to have a paypal account. On the payment screen, on the right side, near the bottom is it says "Don''t have a PayPal account?" Click on this and you will be directed to input your credit card information.'),
(20, '1362739450', '2013-03-08 10:44:10', 'How Can I Change the List Price or Other Information on My Listing?', 'First, you should know that almost anything you want to do with your listing can be done through the Control Panel. Here are the steps you need to make your change.<br>\r\n1. Log into flatratelist.com<br>\r\n2. Click on the Control Panel<br>\r\n3. Under the Control Panel, click on “Make a change to your residential listing” The next page will list all your listing(s).<br>\r\n4. Next to the listing you want to make the change, click on the Edit (the pencil) icon. You will be taken to the Edit Listing page.<br>\r\nOn the Edit Listing Page, make your desired changes. Be sure to scroll down to the bottom of the page and click “Save and View My listing\r\n'),
(21, '1362739483', '2013-03-08 10:44:43', 'How long does it take to activate a new account?', 'Activation is instantaneous.  You will receive a confirmation email to the address you provided. Be sure you provided the correct email when you register.  If you have more than one email, be sure to check the email account you provided at registration. '),
(22, '1362739505', '2013-03-08 10:45:05', 'How do you handle inquiries that you get directly (Internet, etc)? Do you pass them along to me or do you attempt to make the sale yourself. ', 'Even though prospects are instructed in the MLS showing instructions to call you directly, we still receive many requests for showings and prospects are encouraged to contact you directly. With that said, MLS requires our Brokerage’s information appear on the listing. If an individual calls regarding your listing and requests help, of course we going to assist them and guide them in the best practices to buy YOUR home. '),
(23, '1362739522', '2013-03-08 10:45:22', 'How long will you keep the listing active? ', 'Your listings remain active until you sell or request it to be removed.'),
(24, '1362739535', '2013-03-08 10:45:35', 'Do you have a sign available. If so, will it have your telephone or a blank space for mine? ', 'The option to add a sign to your order is coming in the next website update. For now, you will have to provide your own sign.  $10 from Home Depot is a small price to pay for thousands in savings. Thank you for your patients while we update this option.'),
(25, '1362739549', '2013-03-08 10:45:49', 'Do you have a contract to sign?', 'There is no contract to sign. After reading a short agreement, you will click a box signaling agreement with the terms and conditions. That''s it. '),
(26, '1362739584', '2013-03-08 10:46:24', 'How Do I Print a Flyer?', 'You have an option to print a flyer directly from our  website to give to prospective buyers or place in an informational box outside the house. <br>The steps are:<br>\r\n1. Log into flatratelist.com<br>\r\n2.  If you have more than one property for sale, click on the property you want the flyer created.<br>\r\n3. Click on the Control Panel<br>\r\n4. Click “Print a flyer”<br>\r\n'),
(27, '1362739607', '2013-03-08 10:46:47', 'Where is my phone number on the listing?', 'Your phone number IS listed under the showing remarks. Doing it this way instructs Realtors to use the showing button which then provides a record of who was in your home. Without this, we have no way of tracking traffic to your home. Its safe and the way I do it on all homes, including my own.'),
(28, '1373292317', '2013-07-08 14:05:17', 'How do I know my listing is ACTIVE on the MLS?', 'You will be emailed the actual MLS listing for your review. You will also be emailed your listing after requesting any changes. ');
