This stunning house provides an expansive feeling with 9''4" ceiling heights, cathedral ceilings and tray ceilings.  Most of the floors have 20"x20" tile; laid on the diagonal with new plush carpet in the 3 bedrooms.  The kitchen has wood cabinets, granite countertops, granite bar top with arched pass-thru to the Family Room.  The stainless steel appliances include two wall ovens, 36" gas range with impressive hood, side by side refrigerator and dishwasher.  Conveniently adjacent to the kitchen is a large 5'' pantry and the laundry connections are inside the home so you can launder clothes in air-conditioned comfort.  The master suite includes a pair of 8'' tall French doors to the lanai, two walk-in closets, his and hers 36" high vanities with granite tops, shower, toilet room and jetted tub.  The family room has tray ceilings and is large enough for a pool table or a big screen TV for a home theatre experience.  The guest bath has 36" high vanity with granite top and tub/shower with glass doors.  Six ceiling fans will keep you comfortable.  Impact glass windows are in all window openings except the lanai - no need to install shutters on most of this home.  The 9''4" wall height results in an 8'' tall overhead garage door - tall enough for many vans, trucks with ladder racks on top, large SUVs with roof racks, etc. to enter the garage (these vehicles can''t enter the typical 7'' high garage doors).  The back yard is fenced. Plenty of room to add a pool.";s:21:"pay_broker_percentage";s:2:"3%";s:7:"photo_1";s:8:"84fa.jpg";s:7:"photo_2";s:8:"bb84.jpg";s:7:"photo_3";s:8:"8ccb.jpg";s:7:"photo_4";s:8:"e792.jpg";s:7:"photo_5";s:8:"117e.jpg";s:7:"photo_6";s:8:"133e.jpg";s:7:"photo_7";s:8:"7200.jpg";s:7:"photo_8";s:8:"2ecc.jpg";s:7:"photo_9";s:8:"8230.jpg";s:8:"photo_10";s:8:"30aa.jpg";s:8:"photo_11";s:8:"689a.jpg";s:8:"photo_12";s:8:"d6f7.jpg";s:6:"agreed";s:1:"0";s:11:"list_status";s:8:"APPROVED";s:15:"paypal_trans_id";N;s:7:"dump_id";N;}'),
