ime_secure_remarks";s:84:"On Lock-Box. Must get code to open lock-box; condo currently empty; show as needed. ";s:17:"virtual_tour_link";s:0:"";s:11:"internet_yn";s:1:"Y";s:39:"display_property_address_on_internet_yn";s:1:"Y";s:17:"driving_direction";s:247:"Hwy #41 to 111th-N; go west on Bluebill.  Before entering Delnor-Wiggins Park turn right, and right again to go thru gate.  Turn left and then left again into building''s drive-way/parking lot.  (1 Bluebill is the first building in the community.) ";s:20:"realtor_only_remarks";s:390:"Rented Feb-Mar ''15 at $2200/m. Owner financing is good possibility. Some renovations: painting, with new water heater, countertops, JennAire micro-oven combo, cooktop, HVAC, blinds, carpet, tile floor. Latch-key most furniture included.  Bonus:  a large (5x8x8) storage room just across the hall!  With screened 67 sq ft balcony storage (40 sq ft), total condo size equals about 630 sq ft. ";s:14:"public_remarks";s:1500:"Just imagine! An affordable gem in much sought-after LOCATION - popular, acclaimed Vanderbilt Beach! (Compare average real estate prices for this area with Naples'' average!) Light, bright, quiet, comfortable studio; gorgeous western-view sunsets, landscaped yard, conservation wilderness of Mangroves, other trees, blue skies, and gentle breezes! Delnor-Wiggins Pass "State" Park, which lines this beach community, is a Florida natural treasure in itself -- a great place for hiking, jogging, strolling, picnicking with nature. Why not forget about parking problems and purchase this as a jumping-off point for beach and boating activities. Or if you already live near-by, a guest house for visitors! a home away from home! a "get away" all your own!  If you like boating, there''s a marina within the gated community with Gulf access!  Fish off docks or banks of estuary.  And of course, take the few steps to the beach for play, swimming, frolicking, hiking, having fun. For sleeping, two easily accessed and comfortable Murphy bed