rtgage Svcs,Venice 941.485.4222. Buyer may choose a bank of his choice to finance with. Use as is contract. ";s:14:"public_remarks";s:592:"When you drive up the driveway in this very private setting, you will find a home that has new exterior & interior paint, new carpet, new ceramic floor & back splash tile. Kitchen includes refrigerator, smooth top stove, dishwasher & new microwave. No houses on either side or rear provides lots of privacy, yet only 5 minutes to shopping. The large lanai has wooded views and is entered by 3 sets of sliders. The home has been landscaped with 45 flowering shrubs, concrete curbing filled with crushed riverstone.  Washer & dryer have no value on them.  Home sold As Is with Right to Inspect.";s:21:"pay_broker_percentage";s:2:"3%";s:7:"photo_1";s:8:"62ec.JPG";s:7:"photo_2";s:8:"e62b.JPG";s:7:"photo_3";s:8:"a2cd.JPG";s:7:"photo_4";s:8:"f8b1.JPG";s:7:"photo_5";s:8:"1877.JPG";s:7:"photo_6";s:8:"735f.JPG";s:7:"photo_7";s:8:"4d83.JPG";s:7:"photo_8";s:8:"b6f5.JPG";s:7:"photo_9";s:8:"d390.JPG";s:8:"photo_10";s:8:"f3f9.JPG";s:8:"photo_11";s:8:"cacc.JPG";s:8:"photo_12";s:8:"0ebb.JPG";s:6:"agreed";s:1:"0";s:11:"list_status";s:8:"APPROVED";s:15:"paypal_trans_id";N;s:7:"dump_id";s:2:"76";s:18:"housing_for_elders";s:1:"3";}');
