 big barrel orange tile roof. Plush and mature landscaping shows stunning appearance and the privacy hedges are another added bonus. A river rock bed flows around entire exterior and to set it off, it is outlined in a decorative cobblestone curbing. Your new dream home includes a newer AC unit, hot water heater, top of the line updated magnetic pool pump, digital pool heater and extra large seamless gutters around entire house. This is an absolute steal @ $217,900; must sell quickly. Please call 941-447-1097 or 727-793-8518 or 352-586-5285.', '3%', 'e725.png', '3db6.jpg', '3106.jpg', '646f.jpg', '802d.jpg', '3629.jpg', 'cd5d.jpg', '8e5f.jpg', 'de39.jpg', 'd0db.jpg', '8cbc.jpg', '060d.jpg', 0, 'APPROVED', NULL, 39, 3),
