Call owner, Lynn''s cell phone for key box combination. (941) 725-2533', 'http://www.youtube.com/watch?v=W5XJpuDtZKo&feature=youtu.be', 'Y', 'N', 'From SR 776 (McCall Road), turn south onto Spinnaker Blvd, right on Boca Grande Ave, left on Ticonderoga, right on New Martinsville.  Home is on the left.', 'Call owner, Lynn''s cell phone for key box combination. (941) 725-2533', 'This stunning house provides an expansive feeling with 9''4" ceiling heights, cathedral ceilings and tray ceilings.  Most of the floors have 20"x20" tile; laid on the diagonal with new plush carpet in the 3 bedrooms.  The kitchen has wood cabinets, granite countertops, granite bar top with arched pass-thru to the Family Room.  The stainless steel appliances include two wall ovens, 36" gas range with impressive hood, side by side refrigerator and dishwasher.  Conveniently adjacent to the kitchen is a large 5'' pantry and the laundry connections are inside the home so you can launder clothes in air-conditioned comfort.  The master suite includes a pair of 8'' tall French doors to the lanai, two walk-in closets, his and hers 36" high vanities with granite tops, shower, toilet room and jetted tub.  The family room has tray ceilings and is large enough for a pool table or a big screen TV for a home theatre experience.  The guest bath has 36" high vanity with granite top and tub/shower with glass doors.  Six ceiling fans will keep you comfortable.  Impact glass windows are in all window openings except the lanai - no need to install shutters on most of this home.  The 9''4" wall height results in an 8'' tall overhead garage door - tall enough for many vans, trucks with ladder racks on top, large SUVs with roof racks, etc. to enter the garage (these vehicles can''t enter the typical 7'' high garage doors).  The back yard is fenced. Plenty of room to add a pool.', '3%', '84fa.jpg', 'bb84.jpg', '8ccb.jpg', 'e792.jpg', '117e.jpg', '133e.jpg', '7200.jpg', '2ecc.jpg', '8230.jpg', '30aa.jpg', '689a.jpg', 'd6f7.jpg', 0, 'APPROVED', NULL, 24, NULL),
