ear-by, a guest house for visitors! a home away from home! a "get away" all your own!  If you like boating, there''s a marina within the gated community with Gulf access!  Fish off docks or banks of estuary.  And of course, take the few steps to the beach for play, swimming, frolicking, hiking, having fun. For sleeping, two easily accessed and comfortable Murphy beds (a queen and double), are built-in along with drawers and shelves. Includes new water heater, countertops, JennAire micro-oven combo, ceramic cooktop, P-Tac/HVAC, blinds, carpet, tile floor, faucets; recently painted. This "larger than many Vanderbilt efficiencies" can be made a real one bedroom. Screened balcony 67 sq ft; large (5x8x8) storage room across hall; condo total 630 sq ft. Aerial map shows green trees, Gulf/Ocean. This building is closest to beach.  ', '2.5%', '4abb.jpg', 'd99f.jpeg', '438e.jpg', 'deb2.jpg', '8735.jpg', '9108.jpg', 'd940.jpg', 'ce06.jpg', '1286.jpg', '97da.jpg', '1a38.jpg', '918f.jpg', 0, 'PAID', '5NC36368N7654662B', 71, 3),
