 for  information. $500 Bonus for those bringing an acceptable contract that closes within 45 days. Text if no answer.', '  2009 construction. Energy efficient- includes closed foam insulation pkg, 14 SEER AC, instant gas whole house hot water heater, metal roof, front and back porches, three tubular skylights, 4 ceiling fans. Kitchen has SS appliances, slate tile, granite, THREE dishwashers, two sinks, dual fuel range, FR door refrig, eat at bar. Open concept living room/dining room kitchen, vaulted ceilings,11'' book/display cases. Fabulous master suite - beach blue hardwood floors, tray ceiling,built in closet, fr. doors to screened back patio. Move in ready and more than you would expect. Won''t last long once it is seen! ', '3%', '1bb6.jpg', '698f.jpg', '5941.jpg', '8c4e.jpg', '4048.jpg', 'f115.jpg', 'aeca.jpg', 'fc70.jpg', '8534.jpg', '6c7d.jpg', '4893.jpg', 'f131.jpg', 0, 'PAID', '3Y044431SP260014Y', 61, 3),
