om Combo | Master Bedroom Downstairs | Open Plan | Split Bedroom', 'Attic | Blinds/Shades | Ceiling Fan(s) | Dry Bar | Smoke Alarm(s) | Walk In Closet | Washer/Dryer Hookup | Window Treatment', 'Handicapped Accessible | Tub With Shower', '', 'Ceramic Tile | Other', 'Breakfast Bar | Closet Pantry', 'N', '', 'Cash | Conventional | FHA | Seller Financing | USDA | VA', 'Home Warranty | Lead Paint Disclosure | Owner Will Consider Financing | Seller Property Disclosure', 'Bonus to Selling office | Vacant', 'None', 'Call Before Showing | Lock Box - Combination', 'House is vacant and easy to show.  Please call Lyn Hart 423-494-0236 for the lock box combination.', '', 'Y', 'Y', 'South on US-41, West on Harbor to traffic light at Edgewater, left onto Edgewater; 2nd house on right (sailboat water side)next to vacant lot.', 'There is a $1000 bonus to the buyers'' agent at the closing table -  In addition to the 3% commission for the Buyers'' Broker/agent.', 'BRING YOUR BIG SAILBOAT!!\r\nBeautiful 3 bedroom 2 bath SAILBOAT saltwater front home on the Clipper Waterway; Very open floor plan with split bedroom arrangement.  One side has 3'' doorways and halls making it wheelchair accessible.  81'' concrete seawall and large dock.  Only 5 minutes boat ride to the open waters of Charlotte Harbor and then on to the Gulf of Mexico. Fish off your own dock or take a short walk to the Port Charlotte Beach complex with community pool, boat launch, fishing pier, sandy beach, tennis and basketball courts, playground, etc.\r\n\r\nHome has been remodeled with white kitchen cabinets, large ceramic tile floors in the main areas and baths, elongated toilet, 5 ceiling fans, decorator window treatments, etc.  3 sets pocketing glass sliding doors open to the lanai.  Two bedrooms and lanai look out at the Clipper Waterway.  Public water and sewer.\r\nDeep water canal with plenty of water all year round.\r\nHome was built up higher to meet the 9'' base flood elevation so flood insurance is very affordable - under $1000 annually.\r\n\r\nVery convenient location close to all shopping, doctors and hospitals.  Charlotte Harbor is one of the top 10 sailing locations in the U.S.  The Port Charlotte area was recently voted the number 1 place to retire by CNN and "Money Magazine" and is listed among the top places to retire in "Where to Retire" magazine.', '3%', '4889.JPG', 'dca6.jpg', '15e0.jpg', 'd39c.jpg', '3682.jpg', '4083.jpg', 'a533.jpg', '6714.jpg', '6571.jpg', '7328.JPG', '78b5.JPG', 'd746.JPG', 0, 'PENDING', 'tok_104Cao2lug1poUBdUiSKDuNz', 63, 3),
