(71, '2014-07-19 12:44:29', 79, '2014-10-13 12:12:05', 79, 1.00, 'Michael Mitchell', '119 Villa Drive, #119', 'Osprey, FL 34229', 'FL', '34229', 'Sarasota', '941-587-6100', '941-587-6100', 'robertbobmitchell@aol.com', '109 U S-41', 'Nokomis', 'FL', '34275', '', '119', '1', '1', 'Sorrento Villas', '1', '24', '13.5587', 1974, '0160-11-1019', 1777.40, 2013, '23', '38S', '18E', '7030', '', '119', '7030', 'Unit 119, Sorrento Villas', 'Sorrento Villas', 'RMF-2', '', '0401 - condo - Det Single Family', 'Sorrento Villas', 'Villa', 2, 2, 0, 1394, 1905, 'Public Records', 'Fee Simple', 'N', 0.00, 'N', 'N', 'N', '', '', '0', '.000', 'Zero Lot Line', 'Close to Bus Line | Flood Zone | In County | Street Paved | Street Private', 'E', 'BB/HS Internet Avail | Cable Available | Cable Connected | Canal / Lake for irrigation | County Water | Electric | Public Municipal Water | Public Sewer | Sprinkler Well', 'Y', 'Bay/Harbor | Beach-Public | Canal-Saltwater | Gulf/Ocean | Intracoastal Waterway', 'Y', 'Canal | Gulf/ocean Full', 'Y', 'Canl-Saltwater', 'N', 'Completed', NULL, 'N', '', 'Dock/Rack-ominium | End Unit | Ground Floor Unit | One Story', 'Slab', 'Block | Stucco', 'Tile', 'Fruit Trees | Gutters / Downspouts | Outdoor Grill | Sliding Doors', '1 Car Garage', 'Guest Parking | Street Parking | Washer/Dryer Hookup', '13x25', 'Florida | Villa', 'Association Recreation - Owned | Boat Slip | Buyer Approval Required | Community Heated Pool | Community Pool | Deed Restrictions | Dock | Fees Required | Gated Community | Maintenance Free | No Truck/RV/Motorcycle | Water Access | Waterfront Complex', 'Required', 210.00, NULL, NULL, 'Y', 'Y', '', '', '', '26x15', '', '', '', '17x10', '14x12', '12x10', '', '', '', '', '', '', '', 'Breezeway | Inside Utility', 'Central', 'Central | Fuel - Electric', 'Dishwasher | Disposal | Dryer | Exhaust Fan | Hot Water Electric | Microwave | Oven | Range | Refrigerator | Washer', 'Eating Space In Kitchen | Great Room | Kitchen/Family Room Combo | Master Bedro