(2, 'Craigslist is a possibility but expect a lot of investor and unqualified "lookers" I don''t know where you are located but many states offer a flat rate listing service which means you can get your home seen by 85% of all buyers by listing on the MLS for a flat fee. This fee is a nominal up front fee. \r\n\r\nThe up side is, your home is marketed on the same service Realtor''s use, you''ll save thousands in listing commissions and Buyers can be prequalified. The down side is, you pay the nominal fee up front whether you house sells or not. Most, but not all flat fee services try to up sale you and you''ll get little or no advise from the listing Broker. \r\n\r\nRemember, with any service, you will have to designate an amount you will pay should Realtor bring a buyer. You''re still saving thousands and the best part is.... if the buyer finds you on one of the many web sites that extract your listing from the MLS, you may not have to pay ANY commission. In the state of Florida, check out www.flatratelist.com. List and Prosper\r\n', 2, 1335272012, 'Dan Feuser', 'danfeuser@yahoo.com', 'http://flatratelist.com', 3),
(3, 'Florida statutes clearly explains this very type of transaction stating that a negotiated commission  in exchange of a verbal promise to perform in the future is unenforceable should the client choose to not perform. \r\n\r\nWith that said, I''m a Broker and the reality of today’s market would indicate that there are hungry brokers out there willing to take you up on your offer. Paying full asking commissions does not indicate a Sales Agents ability to perform, however, an agent that needs to take a reduced commission is very much an indicator of their past performance and their desperation for a paycheck. Never act in desperation and be leery of anyone who does.\r\n', 2, 1335899709, 'Dan Feuser', 'danfeuser@yahoo.com', 'http://flatratelist.com', 4),
