(7, 'When I work as a buyer''s agent, I love seeing ligtsnis that were taken at less than a fair percentage.  These don''t get shown by many agent''s with buyers, so I know I can negotiate a great deal for my buyer.  The seller actually ends up netting less than if they''d done a 7% listing, offering 4% to a buyer''s agent (then the buyer''s agents are fighting over the house.  That''s how I try to list houses, to help the seller NET the most money.At whatever percentage you do list, make sure to offer at least the normal going rate to buyers agents   and that it''s specified in the listing agreement.  An agent could list your house with a 1% agreement, just to pick up buyers off the sign, then take them to a house that pays them to sell it.', 1, 1340691152, 'Can', 'webmaster@sinmission.com', 'http://www.facebook.com/profile.php?id=100003406178108', 3),
