INSERT INTO `tbl_post` (`id`, `title`, `content`, `tags`, `status`, `create_time`, `update_time`, `author_id`) VALUES
(1, 'Comming Soon...!!', 'Comming Soon...!!', 'blog', 2, 1328669172, 1328669172, 19),
(2, 'Can you be evicted from a house you''ve lived in for 4 months that the person doesn''t own?', 'Your lease agreement is the "bible". With that said, your question is legal in nature so you should consult your attorney. I am not an attorney. An attorney may tell you that if the "landlord" who signed the contract is not the legal owner, your contract is invalid and thus not enforceable. The flip side to this is, if you have an invalid lease, the actual "landlord" may be able to have you forcibly removed for trespassing. \r\n\r\nNote: Just because a home is going through the foreclosure process, doesn''t mean the banks own it yet. In a judicial foreclosure state, title doesn''t change hands until the "sheriffs sale". Until this happens even if the landlord isn''t making the mortgage payment, he/she is still the rightful owner', 'Eviction, lease, contract, landlord, tenant', 2, 1335271580, 1335271686, 1),
(3, 'Hopeless Situation: How do I sell my house?!?!?', 'I feel so hopeless! In a few months my student loans are going to be due and I need to find a way to finance them fast. Not only that, but the home I live in is falling apart and beyond my annual salary repair. I''ve been weighing the option of selling- my home and a few acres that I live on. But, I have no idea where to start. Its overwhelming and I keep putting it off; I know in a few years the place will be uninhabitable because of roofing, flooring, and other critical issues. I need to do something, but need guidance. Where do I begin in selling my home? (Preferably without a realtor, I don''t expect a lot out of it).\r\n', 'Underwater, sell, house, realtor, commission, listing', 2, 1335271899, 1335272047, 1),
(4, 'Realtors: Would you negotiate smaller commission in exchange for?', 'I going the fsbo route and paid $300 to have my house put on the MLS. If you were the buyers agent and submitted an offer, would you be open to negotiating a smaller commission (2% instead of 3%) in exchange for the seller making you his buyers agent when he buys a property? Is this wishful thinking or is it worth asking?', 'fsbo, flat rate, buyers agent, commission', 1, 1335899640, 1335899640, 1);
